css:
.git-control .sidebar {
  width: 30%;
  height: 100%;
  float: left;
  border-right: 1px solid #414346;
  background: inherit;
  padding: 10px 10px 80px 10px;
  overflow-y: scroll;
}
.git-control .sidebar .heading {
  font-weight: bold;
  color: #ffffff;
  margin-bottom: 5px;
  position: relative;
}
.git-control .sidebar .heading .action {
  position: absolute;
  right: 0;
  top: 0;
  display: inline-block;
  cursor: pointer;
  color: #9d9e9f;
}
.git-control .sidebar .heading .action:hover {
  color: #ffffff;
}
.git-control .sidebar .heading .action span {
  margin-right: 5px;
}
.git-control .sidebar .none .heading .action {
  color: #5d6062;
  cursor: default;
}
.git-control .sidebar .none .heading .action:hover {
  color: #5d6062;
}
